require("core-js/modules/es.array.push.js");
var lat = 37.481;
var lng = 126.893;
var zoom = 20;
var mymap = L.map("mapid", {
  center: [lat, lng],
  zoom: zoom
});
L.tileLayer("http://tile.openstreetmap.org/{z}/{x}/{y}.png").addTo(mymap);
var pointList = [];
var pointCnt = 10;
var scale = 1000;
for (var i = 0; i < pointCnt; i++) {
  pointList.push({
    lat: lat + i / scale,
    lng: lng + i / scale,
    count: i
  });
}
for (var i = 0; i < pointCnt; i++) {
  var point = pointList[i];
  L.marker({
    lat: point.lat,
    lng: point.lng
  }).addTo(mymap);
}
